import FORMULARIO_PROYECTO from "../../type/index"

//aqui es donde cambian los states del proyecto
export default (state, action) => {
    switch(action.type) {

        case FORMULARIO_PROYECTO: 
            return {
                ...state,
                formulario: true
            }
        default :
            return state;
    }
}
